import React from "react";

// reactstrap components

// core components
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import IndexHeader from "components/Headers/IndexHeader.js";

// index sections
import SectionTypo from "./index-sections/SectionTypo";
import RegisterPage from "./examples/RegisterPage";
import Ch01 from "./echarts-sections/Ch01";
import Ch02 from "./echarts-sections/Ch02";
import Ch03 from "./echarts-sections/Ch03";
import Ch04 from "./echarts-sections/Ch04";
import Ch05 from "./echarts-sections/Ch05";
import {Container} from "reactstrap";

function Index() {
  document.documentElement.classList.remove("nav-open");
  React.useEffect(() => {
    document.body.classList.add("index");
    return function cleanup() {
      document.body.classList.remove("index");
    };
  });
  return (
    <>
      <IndexNavbar />
      <IndexHeader />
        <Container>
            <h4 className="presentation-subtitle">
                “他们中，大多人前三分之二的岁月中，科技和互联网是日常生活的罕见词。但在人生的后半程，他们如坐过山车般经历了一场又一场信息迭代。”
                <br/>
                <br/>
                <br/>
                新冠疫情的出现，使得还有选择“余地”的老年人群体不得不走上智能化道路，健康码、行程码、扫码取件、网上预约......老年人群体开始了一场“数字长征”。
            </h4>
        </Container>
      <div className="main">
          <SectionTypo />
          <Ch01 />
          <Ch02 />
          <Ch03 />
          <Ch04 />
          <Ch05 />
          <RegisterPage />
      </div>
    </>
  );
}

export default Index;
